import React from 'react'

const UserListItem = ({data}) => {

  const setUserId = (id) =>{
    console.log(id)
  }

  return (
    <div style={{display:'flex'}}>
      <div>{data.id}</div>
      <div>{data.name}</div>
      <div>{data.email}</div>
      <button onClick={setUserId(data.id)}>상세</button>
    </div>
  )
}

export default UserListItem
